// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import TopBar from './components/TopBar';
import NavigationBar from './components/NavigationBar';
import Masthead from './components/Masthead';
import ServicesSection from './components/ServicesSection';
import Footer from './components/Footer';
import ContactPage from './components/navBarPages/ContactPage'; // Make sure the path is correct
import HomePage from './components/navBarPages/homepage';
import ServicesPage from './components/navBarPages/ServicePage';
ServicesPage
function App() {
  return (
    <Router>
      <div>
        <TopBar />
        <NavigationBar />
        {/* Replace Switch with Routes */}
        <Routes>
        <Route path="/" Component={HomePage} />
        <Route path="services" Component={ServicesPage} />
          <Route path="/contact" Component={ContactPage} />
        </Routes>

        {/*<Masthead />*/}
        {/*<ServicesSection />*/}
        {/*<Footer />*/}
      </div>
    </Router>
  );
}

export default App;

//list of edits
// the homepage components can now only be called through the homepage.js to prevent repetetion
